export const CHANGE_SCREEN = 'CHANGE_SCREEN';
export const CHANGE_SCORE = 'CHANGE_SCORE';
expo

export const changeScreen = (screen) => ({
  type: CHANGE_SCREEN,
  payload: screen,
});

export const changeScore = (score) => ({
  type: CHANGE_SCORE,
  payload: score,
});

export const resetGame = () => ({
  type: 'RESET_GAME',
});
